import { Grid } from "@mui/material";
import Navbar from "./components/Navbar";

import "./about.css";

export default function About() {
  return (
    <div>
      <Navbar />
      <Grid
        container
        direction="column"
        justifyContent="center"
        sx={{
          border: "3em solid pink",
          padding: "15em",
        }}
      >
        <Grid
          item
          margin={2}
          sx={{
            border: "1px solid orange"
          }}
        >
          <div className="about_text">
            <h1>Hey Bitch</h1>
          </div>
        </Grid>


        <Grid
          item
          sx={{
            border: "1px solid orange",
          }}
        >
          <h1>Hey Bitch</h1>
        </Grid>
      </Grid>
    </div>
  );
}
